import React, { Fragment, useEffect, useState } from "react";
import { Autocomplete, Grid, TextField } from "@mui/material";
import { IMovie } from "../interfaces/movieInterface";
import movieImage from "../images/movieIMG.jpeg";
import { Link, useHistory } from "react-router-dom";
import { height } from "@mui/system";
import { get, ALL_MOVIES } from "../services/restService";

export const SearchBar = () => {
  const history = useHistory();
  const [suggestions, setSuggestions] = useState();
  const [open, setOpen] = useState(false);
  const [movieData, setMovieData] = useState<IMovie[]>([]);

  useEffect(() => {
    fetchData();
  });

  const fetchData = async () => {
    const data = await get(ALL_MOVIES);
    console.log(data);
  };
  const handleSelect = (event: any, value: any) => {
    history.push({
      pathname: `/movie/${value.id}`,
      state: value,
    });
    //Route to movie page
  };

  return (
    <>
      <Autocomplete
        freeSolo
        id="free-solo"
        disableClearable
        autoHighlight
        sx={{ width: 600 }}
        options={movieData}
        getOptionLabel={(option) => option.title}
        // renderOption={(props, option) => (
        //   <div style={{ cursor: "pointer" }}>
        //     <Grid container spacing={2}>
        //       <Grid item>
        //         <img src={movieImage} width="50px" height="50px" />
        //       </Grid>
        //       <Grid item spacing={0}>
        //         {option.title}
        //       </Grid>
        //     </Grid>
        //   </div>
        // )}
        // renderOption={(props, option) => (
        //   <div>
        //     <Link
        //       style={{ width: "100%", height: "100%" }}
        //       to={{
        //         pathname: `/movie/${option.id}`,
        //         state: option,
        //       }}
        //     >
        //       {option.title}
        //     </Link>
        //   </div>
        // )}
        renderInput={(params) => (
          <TextField
            {...params}
            label="Movie"
            InputProps={{
              ...params.InputProps,
              type: "search",
            }}
          />
        )}
        onChange={(event, value) => handleSelect(event, value)}
      />
    </>
  );
};
